import React from "react";

const ArtistSearchResult = (props) => {
  console.log(props.artistName);
  return (
      <div className="flex hover:scale-105 transition ease-in-out duration-100 place-items-center m-2">
        <img
          className="rounded-lg"
          height={60}
          width={60}
          src={props.link}
          alt=""
        ></img>
        <div>{props.artistName}</div>
      </div>
  );
};

export default ArtistSearchResult;
